import React from 'react'
import { FaHome } from "react-icons/fa";
import {Route,BrowserRouter as Router,Switch,Link} from 'react-router-dom';
import '../App.css' 
import Friends from './Friends';
import Groups from '../Middle-clone/Groups';


function Home() {
    return (
        <div className="middle-div">
        <Router>
        <div className="home"><Link to='/'><FaHome style={{height:'25px',width:'25px',display:'flex'}}>
         
         
         
          </FaHome></Link> 
          <Route path='/' exact component={FaHome}></Route>

          <span className="hometext">Home</span>
           </div>
           </Router>
          <Friends></Friends>
          <Groups></Groups>

       
       
        </div>
    )
}

export default Home
